import React from 'react'

const Content = () => {
    function HandleName() {
        const Names =["Welome"," Have a good day","You can","Believe You"]
        const i = Math.floor(Math.random()*3);
        return Names[i];
    }
  return (
    <div> {HandleName()}</div>
  )
}

export default Content;
